import React from "react";

function MealCategory({ category }) {
  return (
    <div>
      <h1>{category.title}</h1>
      <h1>{category.name}</h1>
      <h1>{category.description}</h1>
      {category.items.map((item) => (
        <p>{item}</p>
      ))}
    </div>
  );
}

export default MealCategory;
